import React, { useEffect } from "react";
import Header from "../Header/Header";
import { motion } from "framer-motion";
import "./Home.css";
function Home() {
  return (
    <>
      <Header />
      <motion.div
        animate={{ x: 250 }}
        transition={{ ease: "easeOut", duration: 1, delay: 0.6 }}
      >
        <div className="home">
          <div className="container">
            <h1 className="title">ME-Inspection</h1>
            <p className="description">
              Lorem Ipsum Lorem IpsumLorem IpsumLorem IpsumLorem Ipsum. Lorem
              IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum Lorem
              IpsumLorem IpsumLorem IpsumLorem IpsumLorem IpsumLorem Ipsum.
            </p>
          </div>
          <div className="home__image"></div>
        </div>
      </motion.div>
    </>
  );
}
export default Home;
